column8:
全品！送料無料キャンペーン実施中！<br>(※一部地域除く詳しくはご利用ガイドをご覧ください)アクア専用ルームランプキット<br><br>車種別設計 LED ルームランプキット<br><br>

大胆かつ繊細なラグジュアリースタイル<br>
インテリアを華やか演出<br><br>

車種別に専用設計されているので、1点でとトータルアップグレードが可能です。<br>
LEDのルームランプに換えるだけで愛車の雰囲気が一層華やかになります。<br>
直進性の高いLEDは足元まで光が届くので、夜間の安全性にもつながり実用性での使用にも十分です。<br>
またLEDなので車内消費電力を抑える事が出来ます。<br>
※HIGHT POWER SMD LED製（ハイパワーSMDLEDライト採用）<br>
※付属の強力両面テープは3M製なので安心です。<br><img src="http://image.rakuten.co.jp/suncardo/cabinet/sign-banner/700x150-20.jpg" border="0">
